import React from "react";
import Icons from "../../assets/Icons";
const BarNote = () => {
  return (
    <div className="bar-note">
      <div className="dp-f inside-bar">
        <div className="input-create">
          <input type="text" placeholder="Create a note..." />
        </div>
        <div className="dp-f outers ">
          <div className="icon-icon icon">
            <Icons focusable="false" name="Check" size="24" viewBox="-3  24 24" />
          </div>
          <div className="icon-icon icon">
            <Icons focusable="false" name="Paint" size="24" viewBox="-3 -3 24 24" />
          </div>
          <div className="icon-icon icon">
            <Icons focusable="false" name="ImageH" size="24" viewBox="-3 -3 24 24" />
          </div>
        </div>
      </div>
    </div>
  );
};

export default BarNote;
